[System.Collections.ArrayList]$myList = @()

For($i=0;$i -lt $scope.Length;$i++) 
{ 

    $ServerName= $($scope[$i].displayName)


        $Accounts = Invoke-Command -ComputerName  $ServerName -ScriptBlock {Get-LocalGroupMember -Group Administrators}
        ForEach ($Account in $Accounts ) { 
        $myobj = New-Object PSObject
            Add-Member -InputObject $myobj -NotePropertyName Computer -NotePropertyValue $Account.PSComputerName    
            Add-Member -InputObject $myobj -NotePropertyName Name -NotePropertyValue $Account.Name    
            Add-Member -InputObject $myobj -NotePropertyName SID -NotePropertyValue $Account.SID
            Add-Member -InputObject $myobj -NotePropertyName PrincipalSource -NotePropertyValue $Account.PrincipalSource
            Add-Member -InputObject $myobj -NotePropertyName ObjectClass -NotePropertyValue $Account.ObjectClass
             if ($AuthorizedServerAdmins -like $Account.Name -Or $AuthorizedServerAdmins -like $Account.Name.split('\')[1]){
                Add-Member -InputObject $myobj -NotePropertyName state -NotePropertyValue "Healthy"
            }elseif($Account.Name -like "*\svc_*"){
                Add-Member -InputObject $myobj -NotePropertyName state -NotePropertyValue "Warning"
            }
            else{
                Add-Member -InputObject $myobj -NotePropertyName state -NotePropertyValue "Critical"
            }                        
            [void]$mylist.add($myobj)
        }



}$mylist | Select Computer,Name, SID,PrincipalSource, ObjectClass, state

